        public bool IsPengawasPM()
        {
            var roleId = HttpContext.User.FindFirst(ClaimTypes.Role).Value;

            if (roleId.Contains("PengawasPM")) //cek jika role Pengawas PM
            {
                return true;
            }
            else
            {
                return false;
            }
        }
        public IActionResult Index()
        {
            var mdl = new BDA.Models.MenuDbModels(db, Microsoft.AspNetCore.Http.Extensions.UriHelper.GetDisplayUrl(db.httpContext.Request).ToLower());
            var currentNode = mdl.GetCurrentNode();
            string pageTitle = currentNode != null ? currentNode.Title : ""; //menampilkan data menu
            CultureInfo culture = new CultureInfo("id-ID");
            ViewBag.Hive = false;

            db.CheckPermission("Geospasial View", DataEntities.PermissionMessageType.ThrowInvalidOperationException); //check permission nya view/lihat nya
            db.InsertAuditTrail("geospasial_Akses_Page", "Akses Page geospasial Investor", pageTitle); //simpan kedalam audit trail

            return View();
        }

        [HttpGet]
        public object getMaps(DataSourceLoadOptions loadOptions, string periode, string pe, string growthtype, string dimension, string investorOrigin)
        {

            var query = new List<StateData>();
            var Regssss = JsonConvert.DeserializeObject<Indonesia>(jsonStringRegs);

            db.Database.CommandTimeout = 420;
            var result = Helper.WSQueryPS.GetBDAPGeospasialInvestorMaps(db, loadOptions, periode, pe, growthtype, dimension, investorOrigin);

            foreach (var r in result.data.AsEnumerable())
            {
                var mr = Regssss.features.FirstOrDefault(x => x.properties.name.ToLower() == "provinsi " + r.Field<string>("lokasi").ToString().ToLower());

                if (mr != null)
                {
                    query.Add(new StateData
                    {
                        coordinates = mr.geometry.coordinates,
                        name = mr.properties.name,
                        value = r.Field<float>("current_value")
                    });
                }
                else
                { // debug liat provinsi mana yang ga ada
                }
            }

            var rgns = Regssss.features.Select(t => new { provinsi = t.properties.name, coordinates = t.geometry.coordinates }).ToList();

            foreach (var region in rgns)
            {
                if (!query.Where(x => x.name.ToLower() == region.provinsi.ToLower()).Any())
                {//kalo ga ada ya diinsert

                    query.Add(new StateData
                    {
                        coordinates = region.coordinates,
                        name = region.provinsi,
                        value = 0
                    });
                }
            }

            var test = new[] {
                new {
                    type = "FeatureCollection",
                    features = query.Select(x =>
                            new { coordinates = x.coordinates,
                            text = x.name,
                            dimension = dimension,
                            value = x.value
                            })
                }
            };

            return DataSourceLoader.Load(test, loadOptions);
        }

        [HttpGet]
        public object GetGridLeaderBoard(DataSourceLoadOptions loadOptions, string periode, string pe, string growthtype, string dimension, string investorOrigin, string LBType, string province)
        {
            string stringPeriodeAwal = null;
            string stringNamaPE = null;
            if (!province.IsNullOrEmpty())
            {
                province = province.Substring(8, province.Length - 1);
            }

            if (periode != null)
            {
                stringPeriodeAwal = Convert.ToDateTime(periode).ToString("yyyy-MM");
                TempData["pawal"] = stringPeriodeAwal;
            }
            if (pe != null)
            {
                stringNamaPE = pe;
                TempData["pe"] = stringNamaPE;
            }

            db.Database.CommandTimeout = 420;
            var result = Helper.WSQueryPS.GetBDAPGeospasialInvestorLB(db, loadOptions, stringPeriodeAwal, stringNamaPE, growthtype, dimension, investorOrigin, LBType, province);

            return JsonConvert.SerializeObject(result);
        }

        [HttpGet]
        public object GetGridDataCVGrowth(DataSourceLoadOptions loadOptions, string periode, string pe, string growthtype, string dimension, string investorOrigin, string province)
        {
            string stringPeriodeAwal = null;
            string stringPeriodeAkhir = null;
            string stringNamaPE = null;
           
            if (!province.IsNullOrEmpty())
            {
                province = province.Substring(8, province.Length - 1);
            }

            if (periode != null)
            {
                if (growthtype == "MoM")
                {
                    stringPeriodeAwal = Convert.ToDateTime(periode).AddMonths(-12).ToString("yyyy-MM");
                }
                else {
                    stringPeriodeAwal = Convert.ToDateTime(periode).AddYears(-12).ToString("yyyy-MM");
                }
                stringPeriodeAkhir = Convert.ToDateTime(periode).ToString("yyyy-MM");
            }
            if (pe != null)
            {
                stringNamaPE = pe;
                TempData["pe"] = stringNamaPE;
            }

            db.Database.CommandTimeout = 420;
            var result = Helper.WSQueryPS.GetBDAPGeospasialInvestorCG(db, loadOptions, stringPeriodeAwal, stringPeriodeAkhir, stringNamaPE, growthtype, dimension, investorOrigin, province);

            return JsonConvert.SerializeObject(result);
        }

